import React from 'react'
import './navbar.css'
import logo from '../../assets/logo4.png'

const showSidebar = () => {
    const sidebar = document.querySelector('.sidebar');
    const quitmeny = document.querySelector('.quit-meny');
    sidebar.style.display = 'flex';
    quitmeny.style.display ='none';

}

const hideSidebar = () => {
    const sidebar = document.querySelector('.sidebar');
    sidebar.style.display = 'none'; 
}

const Navbar = () => {
    return(
       <nav className='navbar-section'>

            <div className='logo-navbar'>

                <li onClick= {showSidebar} className='menu'><a href="#"><svg xmlns="http://www.w3.org/2000/svg" height="24px" viewBox="0 -960 960 960" width="24px" 
                    fill="#000000"><path d="M120-240v-80h720v80H120Zm0-200v-80h720v80H120Zm0-200v-80h720v80H120Z"/></svg></a></li>

                <li onClick = {hideSidebar} className='quit-menu'><a href="#"> <svg xmlns="http://www.w3.org/2000/svg" height="24px" viewBox="0 -960 960 960" width="24px" fill="#000000">
                <path d="m256-200-56-56 224-224-224-224 56-56 224 224 224-224 56 56-224 224 224 224-56 56-224-224-224 224Z"/></svg></a></li>

            <div className='logo-container'>
                <img src={logo} alt="TherapyNow" className='logo'/> 
            </div>
            
            {/* <div className='nav-links'>
                <a href='/' className='nav-link'>Home</a>
                <a href='/about' className='nav-link'>About</a>
                <a href='/reviews' className='nav-link'>Reviews</a>
                <a href='/faq' className='nav-link'>FAQ</a>
                <a href='/contact' className='nav-link'>Contact</a>
            </div> */}

            <ul className='sidebar'>
                <li> <a href='/' className='nav-link'>Home</a></li>
                <li> <a href='/about' className='nav-link'>About</a></li>
                <li> <a href='/reviews' className='nav-link'>Reviews</a></li>
                <li><a href='/faq' className='nav-link'>FAQ</a></li>
                <li><a href='/contact' className='nav-link'>Contact</a> </li>
            </ul>


            <ul className='nav-links'>   
                <li> <a href='/' className='nav-link'>Home</a></li>
                <li> <a href='/about' className='nav-link'>About</a></li>
                <li> <a href='/reviews' className='nav-link'>Reviews</a></li>
                <li><a href='/faq' className='nav-link'>FAQ</a></li>
                <li><a href='/contact' className='nav-link'>Contact</a> </li> 
            </ul>

         
            </div>

            <a href='/login'><button className='btn btn-primary'>Sign in</button></a>

       </nav>
    );
}

export default Navbar;
